package Jojo;

public class jonasen8 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		habuen(5,6);
		habuen(6,7);
	}
	public static void habuen(int n,int m){
		for(int i = 0;i<n;i++)
		{
			for(int j = 0;j<m;j++)
			{
				System.out.print("*");
			}
			System.out.println();
		}
	}

}
